import React, {Component} from 'react';
import SecondaryLayout from "../../layout/SecondaryLayout";
import SuggestFormInputs from "./Inputs/Inputs";
import {FormWrapper, InnerFormSpacer, Title} from "../../common/form_components";
import SuggestFormControls from "./Controls/Controls";
import {Spacer} from "../../common/layout";
import {connect} from "react-redux";
import EnhancedForm from "./EnhancedForm";

import {makeRequest} from "../../../store/ducks/suggest-form/operations";
import {clearForm} from "../../../store/ducks/suggest-form/actions";


class SuggestFormContainer extends Component {

    componentDidMount() {
        // const {fetchCompForm, match} = this.props
        // const alias = match.params.alias
        // fetchCompForm(alias)
        console.log(this.props.suggestFormData)
    }

    componentWillUnmount() {
        // const {clearCompForm} = this.props
        // clearCompForm()
    }

    handleBack() {
        this.props.history.goBack()
    }

    render() {

        // const {makeRequest} = this.props

        return (
            <EnhancedForm
                handleBack={this.handleBack.bind(this)}
            />
        );
    }
}

const mapStateToProps = (state) => ({
    suggestFormData: state.suggestForm
})

export default connect(mapStateToProps, {clearForm, makeRequest})(SuggestFormContainer)
